import React from "react";
import './cnts/cnt.css';
import '../App.css';
import './pages.css';
export const Component = () => {

    const iframePart = () => {
      return {
        __html: '<iframe src="https://www.figma.com/embed?embed_host=share&url=https%3A%2F%2Fwww.figma.com%2Ffile%2FdwJcOkbVxk5F0HqIv46HxW%2FDomi" width="1600px" height="100%"></iframe>',
      };
    };
  
    return (
        <div
          style={{ margin: 'auto', position: 'relative', width: '100%', height: '100%', overflow: 'hidden' }}
          dangerouslySetInnerHTML={iframePart()}
        />
  
    );
  };
const Main =() => {
    return(
        <div className="cnt_wrap">
            <div className="cnt">
                <div className="cnt_tit">이 홈페이지에 대하여..</div>
                <div className="tit_line"></div>
                <div className="cnt_sub_tit">HJY's Portfolio</div>
                <div className="cnt_sec">
                    <div className="figmafile" ref={iframePart()}></div>
                </div>
            </div>
        </div>
    )
    
}

export default Main;
